(134, 'senda.fid--111734c8_1510f6351ee_2b23', 77879, 15, 'true', 'true', '', 'CRLSD00002', 'Camino circular, de fácil trazado. La senda parte desde la Casa del Parque del Cañón del Río Lobos, a través de chopos y sauces llega al nacimiento del río Ucero. El sendero aúna patrimonio natural y cultural ya que el recorrido pasa por el casco urbano, transita por el antiguo canal romano que abastecía de agua a la ciudad de Uxama y asciende hasta el Castillo de Ucero, desde donde tenemos unas magnificas vistas del entorno y el río. Mejores épocas, otoño y primavera', '2010-04-15 22:00:00', '1985-10-15 23:00:00', 0, 'true', 'Desde Casa Parque', 'Senda del Castillo', 1, 3, 2, 'true', 0, 1, '', 0, 7067.027, 0, 90, 'PRC-SO 66', 4, 0, '1', 'Carretera Burgo Sleonardo', 'Ucero', 'Soria', 'Castilla y León', 'Spain', '41.71563', '-3.05026', 'Sue4wDnt9XbnLxi6RtJSPg'),
