(150, 'senda.fid--111734c8_1510f6351ee_2b33', 77878, 15, 'true', 'true', '', 'CRLSD00001', 'Camino circular, de fácil trazado si exceptuamos la cuesta existente frente a la Casa del Parque. La senda permitirá adentrarte entre el sabinar y el bosque pino pudio que tapiza la zona de paramera del cañón y te conducirá hasta el mirador de las Gullurías, desde el que tendrás una impresionante vista del fondo del cañón y un buen observatorio de aves. El regreso se hace por el fondo del cañón, junto al río Lobos.', '2010-04-15 22:00:00', '1985-10-15 23:00:00', 0, 'true', 'Desde Casa Parque', 'Senda de las Gullurías', 1, 3, 2, 'true', 0, 1, '', 0, 8285.325, 0, 90, 'PRC-SO 67', 1, 0, '1', '', 'Ucero', 'Soria', 'Castilla y León', 'Spain', '41.7168525', '-3.0510471', '7VLlRLljkW7_mgOmpiBgFA'),
(151, 'senda.fid--111734c8_1510f6351ee_2b34', 77880, 15, 'true', 'true', '', 'CRLSD00003', 'Deben solicitar permiso los grupos mayores de 50 personas entre 15 de enero y 15 de Julio. Se puede hacer en cualquier sentido. Dada su longitud se recomienda hacer por tramos. Hay que tener precaución en época de lluvias intensas, por la posible presencia de riadas. Recorre el parque natural siguiendo el río Lobos. En su recorrido se podrá apreciar la riqueza natural y cultural que encierra el parque, además de pasar junto a uno de sus mayores puntos de interés: la ermita de San Bartolomé.', '2010-04-15 22:00:00', '1985-10-15 23:00:00', 0, 'true', 'Desde Fuente Engomez (Ucero), Siete ojos (San leonardo de Yagüe) o Hontoria del Pinar', 'Senda del Río', 1, 3, 2, 'true', 0, 1, '', 0, 24468.446, 0, 95, 'PR-SOBU 65', 4, 0, '1', '', 'Ucero', 'Soria', 'Castilla y León', 'Spain', '41.7168525', '-3.0510471', '7VLlRLljkW7_mgOmpiBgFA'),
