(158, 'senda.fid--111734c8_1510f6351ee_2b3b', 79093, 15, 'true', 'false', '', 'FNTSD00001', 'Itinerario de interpretación etnográfica a lo largo de la pista que comunica Cabrejas del Pinar y Muriel de la Fuente. A lo largo de la ruta destacan la interpretación de la taina de La Verguilla, en la que se ha recreado una típica majada ganadera con material etnográfico usado por los pastores y en sus alrededores también se ha recuperado un salegar. La construcción de una réplica de un chozo pastoril atendiendo a los criterios dados por un estudio arqueológico de estas típicas construcciones de la zona para refugiar los rebaños de ovejas. La construcción de una pasarela sobre la Sima del Gato para poder contemplar una de estas formaciones desde arriba, para ello se hizo necesaria la limpieza de la sima dado que tradicionalmente eran lugares donde se vertía la basura. La instalación de un mirador que se ha llamado “del Mirón”, desde el que con sus magníficas vistas se contempla el valle del río Avión con la Laguna de Calatañazor y a lo lejos el Sistema Central. Sin olvidar la puesta en valor de la riqueza cultural de varios elementos de Cabrejas del Pinar', '2010-05-27 22:00:00', '1998-11-11 23:00:00', 0, 'true', 'Desde Muriel o Cabrejas', 'LIC Sabinares de la Sierra de Cabrejas', 1, 1, 2, 'false', 0, 1, '', 0, 11000, 0, 100, 'Ruta paisajística del Sabinar de Calatañazor', 2, 0, '0', 'Calle Real Bajera', 'Muriel de la Fuente', 'Soria', 'Castilla y León', 'Spain', '41.72424', '-2.85817', 'e6aFVC-npzYCTSDsLDIUNg'),
